features.script:
let target = parcel.getFeatureById('target');

// adjust these
let INSPECTED_SCALE = [2, 2, 2];
let INSPECTED_URL = "https://www.dropbox.com/s/c7am8ofom8shrej/5dsiove.vox?dl=0";
let INSPECTED_POSITION = [1.75, 5.75, 4.5];
let INSPECTED_ROTATAION = [0, 1.57, 0]

let NORMAL_SCALE = [0.5, 0.5, 0.5];
let NORMAL_URL = "https://www.dropbox.com/s/oor4v5brq7ehsve/GangnamTrophy.vox?dl=0"
let NORMAL_POSITION = [1, 5.25, 4.25];
let NORMAL_ROTATION = [0, 1.57, 0];

var isInspected = false;

target.on('click', (e) => {
    // toggle inspection mode
    isInspected = !isInspected;

    // change the position, url, rotation based on rotation state
    if (isInspected) {
          target.set ({
              url: INSPECTED_URL,
              scale : INSPECTED_SCALE,
              position : INSPECTED_POSITION,
              rotation : INSPECTED_ROTATAION
          });
    } else {
        target.set ({
              url: NORMAL_URL,
              scale : NORMAL_SCALE,
              position : NORMAL_POSITION,
              rotation : NORMAL_ROTATION
          });          
    }
})
